header{
    background-color: var(--main-color);
    position: relative;
    display: flex;
    justify-content: center;
    width: 100%;
    min-width: 320px;
    height: 100px;
    align-items: center;
    box-shadow: 2px 2px 2px 1px rgba(0, 0, 0, 0.2);
}
.header__container-logo{
    margin: 1rem;
    width: 30%;
    display: flex;
    align-items: center;
}
.header__container-navbar{
    margin: 1rem;
    width: 70%;
}
.header__title{
    color: var(--blanco);
    font-size: x-large;
    font-family: var(--fuente-principal);
    margin-left: 1rem;
}
.header__img-logo{
    width: 50px;
    height: 50px;
    border-radius: 25px;
}
/*MEDIA QUERIES*/
@media (max-width: 991px){
    .header__container-logo{
        color:blue;
    }
    .header__container-navbar{  
        display: none;
    }
}
